var temp = msg.payload.data.spotTemperature;
var spot = {
    x: parseInt(msg.payload.data.x * 1000),
    y: parseInt(msg.payload.data.y * 1000),
}
flow.set("spot",spot);

var log = flow.get("log") || [];

log.push({
    time: new Date(),
    temp: temp
});

while(log.length > 999)
    log.shift();
flow.set("log",log);

msg.payload = spot;
msg.topic = "spot";

return msg;

var max = -1000;
var min = 1000;
var total = 0;

var data = [];
var graph = [
    {
        "series": ["Temp"],
        "data": [],
        "labels": ["xTemp"]
    }
];

msg.payload.forEach(function(sample){
    if( sample.temp > max)
        max = sample.temp;
    if (sample.temp < min)
        min = sample.temp;
    total += sample.temp;
    data.push({
        x: sample.time,
        y: sample.temp
    });
});

flow.set("values",{
    average: (total / msg.payload.length).toFixed(1),
    max: max,
    min: min
});

graph[0].data.push(data);
msg.payload = graph;
return msg;
